const UploadPage: React.FC = () => {
  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" component="h1" gutterBottom>
        Upload Document
      </Typography>

      <Paper sx={{ p: 3 }}>
        <Typography variant="body1">
          This is a placeholder for document upload functionality.
        </Typography>
      </Paper>
    </Box>
  );
};

export default UploadPage;
